      "CoderDojo Foundation charter for CoderDojo": "CoderDojo Foundation charter for CoderDojo",
      "All Dojos are required to agree with the below CoderDojo Charter. This Charter encompasses the basic ethos and core aspects of the CoderDojo movement, which all Dojos are founded on. The introduction of the Charter was announced by co-founder James Whelton to the CoderDojo Organisers Group on the 3rd of December 2013.": "All Dojos are required to agree with the below CoderDojo Charter. This Charter encompasses the basic ethos and core aspects of the CoderDojo movement, which all Dojos are founded on. The introduction of the Charter was announced by co-founder James Whelton to the CoderDojo Organisers Group on the 3rd of December 2013.",
      "For the purposes of this Charter, \"CoderDojo\" shall mean the open source, volunteer led movement orientated around running free not-for-profit coding clubs. \"Dojos\" shall mean the not-for profit coding clubs established to support communities and spread the philosophy of CoderDojo.": "For the purposes of this Charter, \"CoderDojo\" shall mean the open source, volunteer led movement orientated around running free not-for-profit coding clubs. \"Dojos\" shall mean the not-for profit coding clubs established to support communities and spread the philosophy of CoderDojo.",
      "All Dojos are independent, autonomous, community groups set up to inspire young people to learn code. All Dojos have different styles of operating but they all hold the same ethos.": "All Dojos are independent, autonomous, community groups set up to inspire young people to learn code. All Dojos have different styles of operating but they all hold the same ethos.",
      "We commit to inspiring and supporting young people to learn how to create technology": "We commit to inspiring and supporting young people to learn how to create technology",
      "We commit to the highest possible standards of child protection in our jurisdiction": "We commit to the highest possible standards of child protection in our jurisdiction",
      "We commit to not charging children attending nor their parents": "We commit to not charging children attending nor their parents",
      "We commit to encourage parent participation within our Dojo": "We commit to encourage parent participation within our Dojo",
      "We commit to sharing our knowledge for free (libre and open)": "We commit to sharing our knowledge for free (libre and open)",
      "We commit to share our knowledge within our Dojo and to other Dojos": "We commit to share our knowledge within our Dojo and to other Dojos",
      "We commit to take care and uphold the good name of the global CoderDojo community": "We commit to take care and uphold the good name of the global CoderDojo community",
      "We commit to encouraging collaboration, peer to peer mentoring and project work between the attendees": "We commit to encouraging collaboration, peer to peer mentoring and project work between the attendees",
      "We commit to welcoming volunteers and children regardless of gender, race, sexual orientation, creed, religion or ability.": "We commit to welcoming volunteers and children regardless of gender, race, sexual orientation, creed, religion or ability.",
      "CoderDojo Foundation (CDF) commitments to you:": "CoderDojo Foundation (CDF) commitments to you:",
      "CDF commits to act in the interest of the global CoderDojo community": "CDF commits to act in the interest of the global CoderDojo community",
      "CDF commits to facilitating the community to share its knowledge": "CDF commits to facilitating the community to share its knowledge",
      "CDF commits to sharing our resources for free": "CDF commits to sharing our resources for free",
      "CDF commits to encouraging active involvement in our organisation": "CDF commits to encouraging active involvement in our organisation",
      "Agreement": "Agreement",
      "On registration you are making an agreement with the CoderDojo Foundation and agreeing to follow the CoderDojo ethos.": "On registration you are making an agreement with the CoderDojo Foundation and agreeing to follow the CoderDojo ethos.",
      "You are entitled to use the CoderDojo name, logo and website to promote your activity for non commercial use": "You are entitled to use the CoderDojo name, logo and website to promote your activity for non commercial use",
      "You are entitled to fundraise on the condition that it is made explicit you do so for your Dojo or as a group of Dojos under a group name (EG Dojos of California) and inappropriate fundraising is a breach of this Charter.": "You are entitled to fundraise on the condition that it is made explicit you do so for your Dojo or as a group of Dojos under a group name (EG Dojos of California) and inappropriate fundraising is a breach of this Charter.",
      "It is your responsibility to ensure you are compliant with legislation in your jurisdiction when undertaking any activities, including fundraising, for your Dojo or group of Dojos.": "It is your responsibility to ensure you are compliant with legislation in your jurisdiction when undertaking any activities, including fundraising, for your Dojo or group of Dojos.",
      "If the terms of this Charter are breached, CoderDojo Foundation retains the right to remove the group from the website. In this case your coding club shall cease using the CoderDojo name, brand and logo in the promotion of your coding club and on third party websites.": "If the terms of this Charter are breached, CoderDojo Foundation retains the right to remove the group from the website. In this case your coding club shall cease using the CoderDojo name, brand and logo in the promotion of your coding club and on third party websites.",
      "Opinions expressed by any individual Dojo or people in the registered Dojo do not represent the views of CoderDojo Foundation.": "Opinions expressed by any individual Dojo or people in the registered Dojo do not represent the views of CoderDojo Foundation.",
      "CoderDojo Foundation may terminate this Charter with any Dojo without cause on thirty days' notice.": "CoderDojo Foundation may terminate this Charter with any Dojo without cause on thirty days' notice.",
      "As CoderDojo Foundation is an Irish entity, this Charter is subject to Irish law and you agree to that.": "As CoderDojo Foundation is an Irish entity, this Charter is subject to Irish law and you agree to that.",
      "Disclaimer of Liability": "Disclaimer of Liability",
      "CoderDojo Foundation accepts no responsibility or liability whatsoever where a party is injured while engaging in the activities of a registered group. It is the responsibility of each club to ensure they maintain valid and appropriate insurance.": "CoderDojo Foundation accepts no responsibility or liability whatsoever where a party is injured while engaging in the activities of a registered group. It is the responsibility of each club to ensure they maintain valid and appropriate insurance.",
      "You are solely responsible for the activities conducted by your own Dojo. Agreeing to this Charter does not constitute endorsement of those activities by the CoderDojo Foundation.": "You are solely responsible for the activities conducted by your own Dojo. Agreeing to this Charter does not constitute endorsement of those activities by the CoderDojo Foundation.",
