      "Find technical mentors in your community to volunteer at your Dojo.": "Find technical mentors in your community to volunteer at your Dojo.",
      "This is required for you to create a Dojo listing!": "This is required for you to create a Dojo listing!",
      "We recommend a ratio of 1:8 mentors to youths, e.g. for an average Dojo of 24 youth, 3 technical mentors would be suggested. Recruit as many mentors as not all volunteers will be able to make all sessions. If you are having difficulty finding mentors get in touch with local businesses, universities and parent groups.": "We recommend a ratio of 1:8 mentors to youths, e.g. for an average Dojo of 24 youth, 3 technical mentors would be suggested. Recruit as many mentors as not all volunteers will be able to make all sessions. If you are having difficulty finding mentors get in touch with local businesses, universities and parent groups.",
      "Find non-technical mentors. E.g. parents etc.": "Find non-technical mentors. E.g. parents etc.",
      "Background check": "Background check",
      "Locate a suitable free venue in your community.": "Locate a suitable free venue in your community.",
      "Ensure your venue is aware of local health and safety best practices.": "Ensure your venue is aware of local health and safety best practices.",
      "Please add a comment on how you’ve met local health and safety best practices in your region": "Please add a comment on how you’ve met local health and safety best practices in your region",
      "The main points to be aware of in a Dojo setting is extension cables! Make sure these are strapped to the floor and don’t cover pathways.": "The main points to be aware of in a Dojo setting is extension cables! Make sure these are strapped to the floor and don’t cover pathways.",
      "Ensure appropriate public liability insurance for your venue.": "Ensure appropriate public liability insurance for your venue.",
      "Set launch date and regular time for your Dojo": "Set launch date and regular time for your Dojo",
      "Create a plan for what content you would like to cover with your mentors.": "Create a plan for what content you would like to cover with your mentors.",
      "See <a href='http://kata.coderdojo.com/wiki/Learning_Resource' target='_blank'>Kata</a>, the CoderDojo community wiki for more information on learning resources": "See <a href='http://kata.coderdojo.com/wiki/Learning_Resource' target='_blank'>Kata</a>, the CoderDojo community wiki for more information on learning resources",
      "Many Dojos start with Scratch or dive straight into HTML. See Kata, the CoderDojo community wiki for <a href=\"http://kata.coderdojo.com/wiki/Learning_Resource\">more information on learning resources.</a>": "Many Dojos start with Scratch or dive straight into HTML. See Kata, the CoderDojo community wiki for <a href=\"http://kata.coderdojo.com/wiki/Learning_Resource\">more information on learning resources.</a>",
      "Setup ticketing and registration for your Dojo": "Setup ticketing and registration for your Dojo",
      "Ticketing can be done right here in the community platform!": "Ticketing can be done right here in the community platform!",
      "Set up an email address specifically for your Dojo": "Set up an email address specifically for your Dojo",
      "This is important as it will allow multiple people to assist in overseeing the email account.  You can set up a gmail or standard free to use email address for your Dojo (for example docklandsdojo@gmail.com or we can issue you a coderdojo.com email when you are creating a listing on the next stage e.g. docklands.ie@coderdojo.com).": "This is important as it will allow multiple people to assist in overseeing the email account.  You can set up a gmail or standard free to use email address for your Dojo (for example docklandsdojo@gmail.com or we can issue you a coderdojo.com email when you are creating a listing on the next stage e.g. docklands.ie@coderdojo.com).",
      "Set up social media presence for your Dojo. e.g. Facebook, Twitter": "Set up social media presence for your Dojo. e.g. Facebook, Twitter",
      "Learn how to connect with other Dojos on social media and the <a href=\"https://forums.coderdojo.com\">CoderDojo discussion forums</a>": "Learn how to connect with other Dojos on social media and the <a href=\"https://forums.coderdojo.com\">CoderDojo discussion forums</a>",
      "You must find technical mentors before continuing.": "You must find technical mentors before continuing.",
      "You must locate a suitable venue before continuing.": "You must locate a suitable venue before continuing.",
      "You must set a Date and time for your Dojo to take place.": "You must set a Date and time for your Dojo to take place.",
      "You must set an email address for your Dojo.": "You must set an email address for your Dojo.",
      "Please describe how you have background checked your team.": "Please describe how you have background checked your team.",
      "Set up background checking for all volunteers.": "Set up background checking for all volunteers.",
      "The requirements for background checking are specific to the legislation in your jurisdiction. You can see some guidelines on Child Protection and Background Checking on <a href=\"http://kata.coderdojo.com/wiki/Child_Protection_and_Background_Checking\">Kata</a>. Please also ensure you check your local legislation. Please comment below describing the situation in your local Dojo.": "The requirements for background checking are specific to the legislation in your jurisdiction. You can see some guidelines on Child Protection and Background Checking on <a href=\"http://kata.coderdojo.com/wiki/Child_Protection_and_Background_Checking\">Kata</a>. Please also ensure you check your local legislation. Please comment below describing the situation in your local Dojo.",
      "A suitable venue has tables, chairs, heat and ideally, wifi! Canteens, community centers, libraries, schools and corporate offices all make great venues. Venues should not replicate a teacher led classroom environment, instead rearrange the desks and chairs, put youths together and ensure there is space for mentors to walk around and assist the young people. Dojos should only be hosted in public spaces, you cannot host your Dojo in a private residence!": "A suitable venue has tables, chairs, heat and ideally, wifi! Canteens, community centers, libraries, schools and corporate offices all make great venues. Venues should not replicate a teacher led classroom environment, instead rearrange the desks and chairs, put youths together and ensure there is space for mentors to walk around and assist the young people. Dojos should only be hosted in public spaces, you cannot host your Dojo in a private residence!",
      "Please describe how you have ensured health and safety best practices.": "Please describe how you have ensured health and safety best practices.",
      "Please add a comment to let us know the situation with public liability in your Dojo.": "Please add a comment to let us know the situation with public liability in your Dojo.",
      "If your Dojo takes place in a corporate office, school or library it is likely that the existing public liability insurance covers the Dojo. Make sure you check this with the venue host in advance of your first session. If it doesn’t, ask the venue to sponsor the cost of adding it to their policy.": "If your Dojo takes place in a corporate office, school or library it is likely that the existing public liability insurance covers the Dojo. Make sure you check this with the venue host in advance of your first session. If it doesn’t, ask the venue to sponsor the cost of adding it to their policy.",
      "If you build it they will come! Pick a date for your first Dojo session and start working towards it. Dojos can run weekly, bi-weekly or monthly. They can be run on weekdays or weekends it all depends on what suits your community.": "If you build it they will come! Pick a date for your first Dojo session and start working towards it. Dojos can run weekly, bi-weekly or monthly. They can be run on weekdays or weekends it all depends on what suits your community.",
